def cache(func) -> object:
    cache_calls = {}
    def wrapper(*args, **kwargs) -> object:
        tuple_args = args + tuple(kwargs.items())
        if tuple_args in cache_calls:
            return cache_calls[tuple_args]
        result = func(*args, **kwargs)
        cache_calls[tuple_args] = result
        return result
    return wrapper

